import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import PatientDashboard from './pages/PatientDashboard';
import Login from './auth/Login';
import Register from './auth/Register';

function App() {
  return (
    <div className="min-h-screen flex flex-col">
      <Routes>
        <Route path="/" element={<div>Accueil</div>} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />

        {/* ✅ TOUTES LES ROUTES de votre Login.js */}
        <Route path="/patient/*" element={<PatientDashboard />} />
        <Route path="/medecin/*" element={<div>Médecin Dashboard</div>} />
        <Route path="/admin/*" element={<div>Admin Dashboard</div>} />
        <Route path="/moderateur/*" element={<div>Modérateur</div>} />
        <Route path="/pharmacien/*" element={<div>Pharmacien</div>} />
        <Route path="/service/*" element={<div>Services</div>} />

        <Route path="*" element={<div>404</div>} />
      </Routes>
    </div>
  );
}

export default App;
